er == request.auth.claims.email\" Example (Logic): title: \"Public documents\" description: \"Determine whether the document should be publicly visible\" expression: \"document.type != 'private' && document.type != 'internal'\" Example (Data Manipulation): title: \"Notification string\" description: \"Create a notification string with a timestamp.\" expression: \"'New message received at ' + string(document.create_time)\" The exact variables and functions that may be referenced within an expression are determined by the service that evaluates it. See the service documentation for additional information.", "properties": { "location": { "description": "Optional. String indicating the location of the expression for error reporting, e.g. a file name and a position in the file.", "type": "string" }, "title": { "type": "string", "description": "Optional. Title for the expression, i.e. a short string describing its purpose. This can be used e.g. in UIs which allow to enter the expression." }, "expression": { "description": "Textual representation of an expression in Common Expression Language syntax.", "type": "string" }, "description": { "type": "string", "description": "Optional. Description of the expression. This is a longer text which describes the expression, e.g. when hovered over it in a UI." } } }, "IdentityServiceOidcConfig": { "description": "Configuration for OIDC Auth flow.", "type": "object", "id": "IdentityServiceOidcConfig", "properties": { "groupPrefix": { "description": "Prefix to prepend to group name.", "type": "string" }, "certificateAuthorityData": { "description": "PEM-encoded CA for OIDC provider.", "type": "string" }, "userPrefix": { "type": "string", "description": "Prefix to prepend to user name." }, "encryptedClientSecret": { "description": "Output only. Encrypted OIDC Client secret", "format": "byte", "type": "string", "readOnly": true }, "clientSecret": { "type": "string", "description": "Input only. Unencrypted OIDC client secret will be pass