ion": "Git repo configuration for the cluster.", "$ref": "ConfigManagementGitConfig" }, "oci": { "description": "OCI repo configuration for the cluster", "$ref": "ConfigManagementOciConfig" }, "preventDrift": { "type": "boolean", "description": "Set to true to enable the Config Sync admission webhook to prevent drifts. If set to `false`, disables the Config Sync admission webhook and does not prevent drifts." }, "sourceFormat": { "type": "string", "description": "Specifies whether the Config Sync Repo is in “hierarchical” or “unstructured” mode." }, "enabled": { "description": "Enables the installation of ConfigSync. If set to true, ConfigSync resources will be created and the other ConfigSync fields will be applied if exist. If set to false, all other ConfigSync fields will be ignored, ConfigSync resources will be deleted. If omitted, ConfigSync resources will be managed depends on the presence of git field.", "type": "boolean" } }, "description": "Configuration for Config Sync", "type": "object", "id": "ConfigManagementConfigSync" }, "SetIamPolicyRequest": { "description": "Request message for `SetIamPolicy` method.", "id": "SetIamPolicyRequest", "properties": { "policy": { "description": "REQUIRED: The complete policy to be applied to the `resource`. The size of the policy is limited to a few 10s of KB. An empty policy is a valid policy but certain Google Cloud services (such as Projects) might reject them.", "$ref": "Policy" }, "updateMask": { "type": "string", "description": "OPTIONAL: A FieldMask specifying which fields of the policy to modify. Only the fields in the mask will be modified. If no mask is provided, the following default mask is used: `paths: \"bindings, etag\"`", "format": "google-fieldmask" } }, "type": "object" }, "MembershipFeatureSpec": { "type": "object", "description": "MembershipFeatureSpec contains configuration information for a single Membership.", "properties": { "identityservice": { "description": "Identity Service-specific spec.", "