tionalProperties": { "type": "string" } }, "locationId": { "description": "The canonical id for this location. For example: `\"us-east1\"`.", "type": "string" }, "metadata": { "additionalProperties": { "type": "any", "description": "Properties of the object. Contains field @type with type URL." }, "type": "object", "description": "Service-specific metadata. For example the available capacity at the given location." } }, "description": "A resource that represents Google Cloud Platform location.", "id": "Location", "type": "object" }, "IdentityServiceAuthMethod": { "id": "IdentityServiceAuthMethod", "type": "object", "properties": { "name": { "description": "Identifier for auth config.", "type": "string" }, "oidcConfig": { "description": "OIDC specific configuration.", "$ref": "IdentityServiceOidcConfig" }, "proxy": { "type": "string", "description": "Proxy server address to use for auth method." } }, "description": "Configuration of an auth method for a member/cluster. Only one authentication method (e.g., OIDC and LDAP) can be set per AuthMethod." }, "KubernetesResource": { "type": "object", "properties": { "connectResources": { "items": { "$ref": "ResourceManifest" }, "description": "Output only. The Kubernetes resources for installing the GKE Connect agent This field is only populated in the Membership returned from a successful long-running operation from CreateMembership or UpdateMembership. It is not populated during normal GetMembership or ListMemberships requests. To get the resource manifest after the initial registration, the caller should make a UpdateMembership call with an empty field mask.", "type": "array", "readOnly": true }, "membershipResources": { "description": "Output only. Additional Kubernetes resources that need to be applied to the cluster after Membership creation, and after every update. This field is only populated in the Membership returned from a successful long-running operation from CreateMembership or UpdateMembership. It is not popul