g" }, "uniqueId": { "description": "Output only. Google-generated UUID for this resource. This is unique across all Membership resources. If a Membership resource is deleted and another resource with the same name is created, it gets a different unique_id.", "readOnly": true, "type": "string" } }, "id": "Membership" }, "ConfigManagementGitConfig": { "description": "Git repo configuration for a single cluster.", "id": "ConfigManagementGitConfig", "properties": { "syncRepo": { "description": "The URL of the Git repository to use as the source of truth.", "type": "string" }, "syncWaitSecs": { "description": "Period in seconds between consecutive syncs. Default: 15.", "type": "string", "format": "int64" }, "policyDir": { "description": "The path within the Git repository that represents the top level of the repo to sync. Default: the root directory of the repository.", "type": "string" }, "gcpServiceAccountEmail": { "description": "The GCP Service Account Email used for auth when secret_type is gcpServiceAccount.", "type": "string" }, "syncBranch": { "type": "string", "description": "The branch of the repository to sync from. Default: master." }, "secretType": { "type": "string", "description": "Type of secret configured for access to the Git repo. Must be one of ssh, cookiefile, gcenode, token, gcpserviceaccount or none. The validation of this is case-sensitive. Required." }, "syncRev": { "description": "Git revision (tag or hash) to check out. Default HEAD.", "type": "string" }, "httpsProxy": { "type": "string", "description": "URL for the HTTPS proxy to be used when communicating with the Git repo." } }, "type": "object" }, "ListLocationsResponse": { "type": "object", "id": "ListLocationsResponse", "properties": { "nextPageToken": { "description": "The standard List next-page token.", "type": "string" }, "locations": { "description": "A list of locations that matches the specified filter in the request.", "items": { "$ref": "Location" }, "type": "array" } }, "description": "The response message for Locations.ListLocations." }, "MembershipEndpoint": { "id": "MembershipEndpoint", "description": "MembershipEndpoint contains information needed to contact a Kubernetes API, endpoint and any additional Kubernetes metadata.", "properties": { "edgeCluster": { "$ref": "EdgeCluster", "description": "Optional. Specific information for a Google Edge cluster." }, "gkeCluster": { "$ref": "GkeCluster", "description": "Optional. Specific information for a GKE-on-GCP cluster." }, "multiCloudCluster": { "$ref": "MultiCloudCluster", "description": "Optional. Specific information for a GKE Multi-Cloud cluster." }, "applianceCluster": { "$ref": "ApplianceCluster", "description": "Optional. Specific information for a GDC Edge Appliance cluster." }, "kubernetesMetadata": { "description": "Output only. Useful Kubernetes-specific metadata.", "$ref": "KubernetesMetadata", "readOnly": true }, "kubernetesResource": { "description": "Optional. The in-cluster Kubernetes Resources that should be applied for a correctly registered cluster, in the steady state. These resources: LICENSE Makefile README.md gsa_key.json lua-resty-gcp-dev-1.rockspec lua-resty-gcp-scm-1.rockspec.original lua-resty-gcp-scm-1.rockspec.template spec src upload.sh Ensure that the cluster is exclusively registered to one and only one Hub Membership. LICENSE Makefile README.md gsa_key.json lua-resty-gcp-dev-1.rockspec lua-resty-gcp-scm-1.rockspec.original lua-resty-gcp-scm-1.rockspec.template spec src upload.sh Propagate Workload Pool Information available in the Membership Authority field. LICENSE Makefile README.md gsa_key.json lua-resty-gcp-dev-1.rockspec lua-resty-gcp-scm-1.rockspec.original lua-resty-gcp-scm-1.rockspec.template spec src upload.sh Ensure proper initial configuration of default Hub Features.", "$ref": "KubernetesResource" }, "onPremCluster": { "$ref": "OnPremCluster", "description": "Optional. Specific information for a GKE On-Prem cluster. An onprem user-cluster who has no resourceLink is not allowed to use this field, it should have a nil \"type\" instead." } }, "type": "object" }, "ResourceManifest": { "type": "object", "id": "ResourceManifest", "description": "ResourceManifest represents a single Kubernetes resource to be applied to the cluster.", "properties": { "clusterScoped": { "type": "boolean", "description": "Whether the resource provided in the manifest is `cluster_scoped`. If unset, the manifest is assumed to be namespace scoped. This field is used for REST mapping when applying the resource in a cluster." }, "manifest": { "type": "string", "description": "YAML manifest of the resource." } } }, "ConfigManagementMembershipSpec": { "type": "object", "description": "**Anthos Config Management**: Configuration for a single cluster. Intended to parallel the ConfigManagement CR.", "id": "ConfigManagementMembershipSpec", "properties": { "policyController": { "description": "Policy Controller configuration for the cluster.", "$ref": "ConfigManagementPolicyController" }, "hierarchyController": { "$ref": "ConfigManagementHierarchyControllerConfig", "description": "Hierarchy Controller configuration for the cluster." }, "version": { "description": "Version of ACM installed.", "type": "string" }, "configSync": { "description": "Config Sync configuration for the cluster.", "$ref": "ConfigManagementConfigSync" } } }, "AnthosVMMembershipState": { "id": "AnthosVMMembershipState", "properties": { "subfeatureState": { "type": "array", "items": { "$ref": "AnthosVMSubFeatureState" }, "description": "List of AnthosVM subfeature states" }, "localControllerState": { "$ref": "LocalControllerState", "description": "State of the local PE-controller inside the cluster" } }, "description": "AnthosVMFeatureState contains the state of the AnthosVM feature. It represents the actual state in the cluster, while the AnthosVMMembershipSpec represents the desired state.", "type": "object" }, "ConfigManagementOperatorState": { "properties": { "version": { "description": "The semenatic version number of the operator", "type": "string" }, "deploymentState": { "enumDescriptions": [ "Deployment's state cannot be determined", "Deployment is not installed", "Deployment is installed", "Deployment was attempted to be installed, but has errors" ], "description": "The state of the Operator's deployment", "type": "string", "enum": [ "DEPLOYMENT_STATE_UNSPECIFIED", "NOT_INSTALLED", "INSTALLED", "ERROR" ] }, "errors": { "description": "Install errors.", "type": "array", "items": { "$ref": "ConfigManagementInstallError" } } }, "type": "object", "description": "State information for an ACM's Operator", "id": "ConfigManagementOperatorState" }, "ConfigManagementHierarchyControllerDeploymentState": { "type": "object", "description": "Deployment state for Hierarchy Controller", "properties": { "extension": { "enumDescriptions": [ "Deployment's state cannot be determined", "Deployment is not installed", "Deployment is installed", "Deployment was attempted to be installed, but has errors" ], "enum": [ "DEPLOYMENT_STATE_UNSPECIFIED", "NOT_INSTALLED", "INSTALLED", "ERROR" ], "type": "string", "description": "The deployment state for Hierarchy Controller extension (e.g. v0.7.0-hc.1)" }, "hnc": { "enum": [ "DEPLOYMENT_STATE_UNSPECIFIED", "NOT_INSTALLED", "INSTALLED", "ERROR" ], "type": "string", "enumDescriptions": [ "Deployment's state cannot be determined", "Deployment is not installed", "Deployment is installed", "Deployment was attempted to be installed, but has errors" ], "description": "The deployment state for open source HNC (e.g. v0.7.0-hc.0)" } }, "id": "ConfigManagementHierarchyControllerDeploymentState" }, "Policy": { "properties": { "bindings": { "items": { "$ref": "Binding" }, "type": "array", "description": "Associates a list of `members`, or principals, with a `role`. Optionally, may specify a `condition` that determines how and when the `bindings` are applied. Each of the `bindings` must contain at least one principal. The `bindings` in a `Policy` can refer to up to 1,500 principals; up to 250 of these principals can be Google groups. Each occurrence of a principal counts towards these limits. For example, if the `bindings` grant 50 different roles to `user:alice@example.com`, and not to any other principal, then you can add another 1,450 principals to the `bindings` in the `Policy`." }, "version": { "format": "int32", "description": "Specifies the format of the policy. Valid values are `0`, `1`, and `3`. Requests that specify an invalid value are rejected. Any operation that affects conditional role bindings must specify version `3`. This requirement applies to the following operations: LICENSE Makefile README.md gsa_key.json lua-resty-gcp-dev-1.rockspec lua-resty-gcp-scm-1.rockspec.original lua-resty-gcp-scm-1.rockspec.template spec src upload.sh Getting a policy that includes a conditional role binding LICENSE Makefile README.md gsa_key.json lua-resty-gcp-dev-1.rockspec lua-resty-gcp-scm-1.rockspec.original lua-resty-gcp-scm-1.rockspec.template spec src upload.sh Adding a conditional role binding to a policy LICENSE Makefile README.md gsa_key.json lua-resty-gcp-dev-1.rockspec lua-resty-gcp-scm-1.rockspec.original lua-resty-gcp-scm-1.rockspec.template spec src upload.sh Changing a conditional role binding in a policy LICENSE Makefile README.md gsa_key.json lua-resty-gcp-dev-1.rockspec lua-resty-gcp-scm-1.rockspec.original lua-resty-gcp-scm-1.rockspec.template spec src upload.sh Removing any role binding, with or without a condition, from a policy that includes conditions **Important:** If you use IAM Conditions, you must include the `etag` field whenever you call `setIamPolicy`. If you omit this field, then IAM allows you to overwrite a version `3` policy with a version `1` policy, and all of the conditions in the version `3` policy are lost. If a policy does not include any conditions, operations on that policy may specify any valid version or leave the field unset. To learn which resources support conditions in their IAM policies, see the [IAM documentation](https://cloud.google.com/iam/help/conditions/resource-policies).", "type": "integer" }, "etag": { "format": "byte", "description": "`etag` is used for optimistic concurrency control as a way to help prevent simultaneous updates of a policy from overwriting each other. It is strongly suggested that systems make use of the `etag` in the read-modify-write cycle to perform policy updates in order to avoid race conditions: An `etag` is returned in the response to `getIamPolicy`, and systems are expected to put that etag in the request to `setIamPolicy` to ensure that their change will be applied to the same version of the policy. **Important:** If you use IAM Conditions, you must include the `etag` field whenever you call `setIamPolicy`. If you omit this field, then IAM allows you to overwrite a version `3` policy with a version `1` policy, and all of the conditions in the version `3` policy are lost.", "type": "string" }, "auditConfigs": { "description": "Specifies cloud audit logging configuration for this policy.", "items": { "$ref": "AuditConfig" }, "type": "array" } }, "id": "Policy", "type": "object", "description": "An Identity and Access Management (IAM) policy, which specifies access controls for Google Cloud resources. A `Policy` is a collection of `bindings`. A `binding` binds one or more `members`, or principals, to a single `role`. Principals can be user accounts, service accounts, Google groups, and domains (such as G Suite). A `role` is a named list of permissions; each `role` can be an IAM predefined role or a user-created custom role. For some types of Google Cloud resources, a `binding` can also specify a `condition`, which is a logical expression that allows access to a resource only if the expression evaluates to `true`. A condition can add constraints based on attributes of the request, the resource, or both. To learn which resources support conditions in their IAM policies, see the [IAM documentation](https://cloud.google.com/iam/help/conditions/resource-policies). **JSON example:** { \"bindings\": [ { \"role\": \"roles/resourcemanager.organizationAdmin\", \"members\": [ \"user:mike@example.com\", \"group:admins@example.com\", \"domain:google.com\", \"serviceAccount:my-project-id@appspot.gserviceaccount.com\" ] }, { \"role\": \"roles/resourcemanager.organizationViewer\", \"members\": [ \"user:eve@example.com\" ], \"condition\": { \"title\": \"expirable access\", \"description\": \"Does not grant access after Sep 2020\", \"expression\": \"request.time \u003c timestamp('2020-10-01T00:00:00.000Z')\", } } ], \"etag\": \"BwWWja0YfJA=\", \"version\": 3 } **YAML example:** bindings: - members: - user:mike@example.com - group:admins@example.com - domain:google.com - serviceAccount:my-project-id@appspot.gserviceaccount.com role: roles/resourcemanager.organizationAdmin - members: - user:eve@example.com role: roles/resourcemanager.organizationViewer condition: title: expirable access description: Does not grant access after Sep 2020 expression: request.time \u003c timestamp('2020-10-01T00:00:00.000Z') etag: BwWWja0YfJA= version: 3 For a description of IAM and its features, see the [IAM documentation](https://cloud.google.com/iam/docs/)." }, "FeatureState": { "type": "object", "properties": { "code": { "description": "The high-level, machine-readable status of this Feature.", "type": "string", "enum": [ "CODE_UNSPECIFIED", "OK", "WARNING", "ERROR" ], "enumDescriptions": [ "Unknown or not set.", "The Feature is operating normally.", "The Feature has encountered an issue, and is operating in a degraded state. The Feature may need intervention to return to normal operation. See the description and any associated Feature-specific details for more information.", "The Feature is not operating or is in a severely degraded state. The Feature may need intervention to return to normal operation. See the description and any associated Feature-specific 